import fetcher from '../fetcher';

const getApartment = async () => {
    try{
        const {data} = await fetcher.get("/apartments");
        return data;
    }catch(error){
        throw new Error(`Cant get apartments`);
    }
}


const getCountries = (handleSuccess) => {
    axios.get(`http://localhost:8000/countries`)
    .then(success => {
        handleSuccess(success.data)
        console.log("hereee", success.data)
    }).catch(error => console.log(error))
} 

export {getCountries};
